function processQueue() {
  if (processing || apiCallQueue.length === 0) {
    return;
  }
  processing = true;
  var apiCall = apiCallQueue.shift();
  apiCall().then(function () {
    processing = false;
    processQueue();
  }).catch(function (error) {
    console.error(error);
    processing = false;
    processQueue();
  });
}

//
function enqueueApiCall(apiCall) {
  return new Promise(function (resolve, reject) {
    apiCallQueue.push(function () {
      return apiCall().then(resolve).catch(reject);
    });
    processQueue();
  });
}

